const localhost = 'https://promo-code-shop-backend.herokuapp.com'
const apiURL = '/api/v1'
const endpoint =  `${localhost}${apiURL}`

export const loginUrl = `${localhost}/login`;
export const promoCardListUrl = `${endpoint}/promo-card/all`;
export const companiesListUrl = `${endpoint}/promo-code-company/all`;
